import React from 'react';
import styled from 'styled-components';

const videos = [
  { url: '/assets/video1.mp4', title: 'Perfume 1' },
  { url: '/assets/video2.mp4', title: 'Perfume 2' },
  { url: '/assets/video3.mp4', title: 'Perfume 3' },
  { url: '/assets/video4.mp4', title: 'Perfume 4' },
  { url: '/assets/video5.mp4', title: 'Perfume 5' },
];

const Container = styled.div`
  background: #0f0f0f;
  min-height: 100vh;
  padding: 40px 20px;
  color: white;
  font-family: 'Segoe UI', sans-serif;
`;

const Title = styled.h1`
  text-align: center;
  font-size: 2.5rem;
  background: linear-gradient(to right, #ff6ec4, #7873f5);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  margin-bottom: 40px;
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 24px;
`;

const Card = styled.div`
  background: #1a1a1a;
  border-radius: 12px;
  overflow: hidden;
  box-shadow: 0 6px 20px rgba(255, 255, 255, 0.05);
  transition: transform 0.3s ease;

  &:hover {
    transform: scale(1.03);
  }
`;

const Video = styled.video`
  width: 100%;
  height: auto;
  display: block;
`;

const Label = styled.div`
  padding: 12px;
  font-size: 1rem;
  color: #ddd;
  text-align: center;
`;

const SimpleVideoGallery = () => {
  return (
    <Container>
      <Title>ðŸŒ¸ Perfume Gallery</Title>
      <Grid>
        {videos.map((video, index) => (
          <Card key={index}>
            <Video src={video.url} controls muted playsInline />
            <Label>{video.title}</Label>
          </Card>
        ))}
      </Grid>
    </Container>
  );
};

export default SimpleVideoGallery;
